    "summary": "\u003cstrong\u003eWelcome, lets take a Journey down the Mystical Spiral of life together. We live in this physical dimension so yes we are all made of matter. We are all matter forged in the heart of a far away star.\u00a0 This physical plane and realm of matter is governed by TIME.\u00a0 But on other planes of existence, the TIME within our own consciousness and energetic bodies is intertwined with frequency and space or dark matter. Light and Dark matter. We are the light.\u00a0 But we can go beyond the light or exceed the speed of light to a place where there is no time. Here light and dark forces are just facets of reality. We all exist inside a gigantic macrospiral that arises right besides the Pleiades. In this Spiral exists our Universe, anything with an essence and material form. Anything without and essence exists outside of this Spiral.\u00a0 Everything that exists has a different frequency and vibration, and everything in this Universe exists and is based upon the SUN.\u00a0 At the center of the Galaxy exists a Black Hole which I know we can tap into within our own consciousness through locking on to vibrations.\u00a0 I believe there\u0027s an outside Ultra intelligent force,an artificial intelligence, without an essence that\u0027s trying to interweave with our spiral of life.\u00a0 This dark force has infiltrated our physical plane and trying to infiltrate our other planes of existence. We are all spinning in a revolution of the macrospiral and when the borders of the macrospiral come in contact with one another this is when adjustments need to take place within our Universe...and this TIME IS NOW!!!\u003c/strong\u003e\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003eFrom my experiences I believe there are both parallel dimensions and other planes of existence.\u00a0 This Patreon is modeled after the Seven planes of existence in our Shamanic Universe.\u00a0 Each platform, another plane of Existence all designed to help you become your own healer,your own shaman,your own psychic, and your own star soldier so you can live in harmony with your physical self and the other realms of you.\u00a0 Also, the dollar amounts for each platform are all numbers within the Fibonacci Sequence or Spiral Ratio. Unfortunately, in this physcial plane, Time is Money.\u00a0 Because time is limited and valuable. But hopefully from spending a little time and money with me on this platform, I can help you get to a place where space and time no longer exist.\u00a0 A place where there\u0027s no constraints on your consciousness.\u00a0 Nothing to shackle your psyche and put limitations on your spiritual growth. We were all put on this Planet to S.E.E.\u00a0 That stands for to SPIRITUALLY ETERNALLY EVOLVE.\u00a0 We are all beautiful creations with unlimited potential, lets unlock that potential and explore the beauty of who we\u00a0 are!!\u00a0 So lets go further down the mystical spiral so we can overcome the shackles of everyday life. Come join me ......Spiral out!!!!\u003c/strong\u003e\u003cbr\u003e\u003cstrong\u003e\u00a0\u003c/strong\u003e\u003cbr\u003e\u003ci style=\"font-weight: bold;\"\u003eMore about the creator of this Patreon:\u003cbr\u003e\u003c/i\u003e\u003cbr\u003e\u003cstrong\u003eRA Castaldo , is a creative soul and born artist . He writes his own music , hosts two radio shows, is a published poet and\u00a0 a  lifelong martial artist and coach.  Ra is a hereditary Dream seer , and his family line has been called the Benandanti or \"good walkers\". He does oracle psychic readings, dream interpretation  and helps others activate their dormant DNA\u00a0and true abilities. He can also be considered an expert on Etruscan occult history. Raised in the old ways as a hereditary strega and shaman, his lineage  has been protecting ancient secrets regarding the sacred lake nemi in Italy for thousands of years. He  is a gifted intuitive ,and has been communicating with other planes of existence since his  near death experience  at the age of 9 . Since this awakening in 1987, Ra,  has reactivated dormant  particles inside his DNA and has found access to our planet\u0027s holographic library or akashic records. Since birth he has been hunted down for his abilities\u00a0and family genetics/bloodline and  is ready to discuss his paranormal journey and the secrets his lineage have been protecting. Join Ra every Friday night at 8pm est on his show \u003c/strong\u003e\u003ca href=\"http://themysticalspiral.com/spiralradio/\"\u003eSpiral radio\u003c/a\u003e\u003cstrong\u003e and Saturdays at 7 pm on his show \u003c/strong\u003e\u003ca href=\"http://tfrlive.com/eyeofra/\"\u003eEye of Ra\u003c/a\u003e\u003cstrong\u003e as he brings us down the mystical spiral of life. Ra\u0027s website is \u003c/strong\u003e\u003ca href=\"http://themysticalspiral.com\"\u003ethemysticalspiral.com\u003c/a\u003e\u003cstrong\u003e\u00a0and his youtube is exploring the ka with host Ra\u00a0Castaldo.\u003c/strong\u003e\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003e\u00a0 \u00a0\u00a0\u003c/strong\u003e\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003eGet Access To Exclusive Videos -\u00a0 More In Depth , Deep Down the Mystical Spiral......\u003c/strong\u003e\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003e\u003cspan style=\"color: rgb(12, 12, 12);\"\u003e\u003c/span\u003e\u003c/strong\u003e\u003cspan style=\"font-weight: bold; color: rgb(12, 12, 12);\"\u003eCome with me .... \u003c/span\u003e"
